import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import { Router, BrowserRouter } from 'react-router-dom'
import App from './App';

const Main  = () => {
  return (
    <BrowserRouter>
      <App />
    </BrowserRouter>
  )
}

ReactDOM.render(<Main />, document.getElementById('root'));
